// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import { LibDiamond } from "../libraries/LibDiamond.sol";
import "../interfaces/IVaultFacet.sol";
import "../interfaces/IKIP7.sol";
import "../utils/math/SafeMath.sol";
import "../interfaces/IUsageFacet.sol";
import "../interfaces/IRewardFacet.sol";


contract VaultFacet is IVaultFacet{
    using SafeMath for uint256;

    uint256 constant private MULTIPLIER_DIVISOR = 10;
    string constant private KEY_LOCK_PERIOD = "lock_period";
    string constant private KEY_LOCK_COUNT = "lock_count";

    function lockCount(address _user) external override view returns(uint256) {
        LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();
        return ds.userLocksCount[_user];
    }


    event FinixLock(address _user,uint256 indexed _lockAmount,uint256 _vFinixAmount,uint256 indexed _lockIndex,bytes32 indexed _lockKey);
    function lock(LibDiamond.LockLevel _level,uint256 _lockAmount) external override {
        LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();
        (,uint256 multiplier_,uint256 minimum_, , , ) = _getLockPerioid(_level);
        require(_lockAmount >= minimum_,"VFinix: Minimum amount requirement not met.");
        address FINIX = LibDiamond.getAddress(keccak256(abi.encodePacked("FINIX")));
        IKIP7(FINIX).transferFrom(msg.sender, address(this), _lockAmount);
        // Calculate vFINIX return
        uint256 vFinixAmount = _lockAmount.mul(multiplier_).div(MULTIPLIER_DIVISOR);

        uint256 userLocksCount_ = ds.userLocksCount[msg.sender];
        uint256 userLocksAmount_ = ds.userLocksAmount[msg.sender];
        bytes32 key = keccak256(abi.encode(msg.sender,userLocksCount_));
        ds.locksMap[key] = LibDiamond.LockInfo(userLocksCount_,_level,_lockAmount,vFinixAmount,block.timestamp,0,0,false,false);
        emit FinixLock(msg.sender,_lockAmount,vFinixAmount,userLocksCount_,key);

        ds.userLocksCount[msg.sender] = userLocksCount_.add(1);
        ds.userLocksAmount[msg.sender] = userLocksAmount_.add(_lockAmount);
        _increaseTotalLockCount();
        _increaseTotalLevelLockCount(_level);
        // update lock data
        ds.totalFinixLockAtLevel[_level] = ds.totalFinixLockAtLevel[_level].add(_lockAmount);
        ds.totalFinixLock = ds.totalFinixLock.add(_lockAmount);
        // Harvest if applicable
        // IRewardFacet(address(this)).harvest(msg.sender);
        // mint vFINIX
        _mintVFinix(msg.sender, vFinixAmount);
        _increaseTotalSupplyAllTimeMint(vFinixAmount);

        // mark deposit
        IRewardFacet(address(this)).deposit(msg.sender,vFinixAmount);
    }
    event finixUnlock(address _user,uint256  _finixTranferAmount,uint256  _vfinixBurnAmount,uint256  _unlockIndex);
    event finixUnlockPenalty(address indexed _user, uint256 indexed _unlockIndex, LibDiamond.LockLevel indexed _level, uint256 _vfinixBurnAmount);

    function unlock(uint256 _lockIndex) external override {
        LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();
        // Get FINIX Address from Eternal Storage
        address FINIX = LibDiamond.getAddress(
            keccak256(abi.encodePacked("FINIX"))
        );
        // TDO: Yield Operation
        IRewardFacet(address(this)).harvest(msg.sender);

        // Get Lock info
        bytes32 key = keccak256(abi.encode(msg.sender, _lockIndex));
        LibDiamond.LockInfo storage lockInfo_ = ds.locksMap[key];

        require(lockInfo_.isPenalty == false,"VFinixVault: You are being penalty");

        require(
            lockInfo_.isUnlocked == false,
            "vFinixVault: This has already been unlocked."
        );

        // Check ending period
        (uint256 period_, , , , ,) = _getLockPerioid(lockInfo_.level);
        // TO FIX LOGIC
        // require(block.timestamp > lockInfo_.lockTimestamp + period_,"vFinixVault: Lock period is not ended yet.");
        // Check for available vFinix from all farms and pools staking
        uint256 availableVotes = IUsageFacet(address(this)).getAvailableVotes(msg.sender);

        require(availableVotes >= lockInfo_.voteAmount,"VFinixVault: Not enough vFinix to withdraw");

        if (block.timestamp < lockInfo_.lockTimestamp + period_) {
            // ((((lockInfo_.lockTimestamp + period_) - block.timestamp) * 10) / 86400 )/10; // 
                address burnAddress = LibDiamond.getAddress(keccak256(abi.encodePacked("VaultPenaltyFacet.burn_address")));
                IRewardFacet(address(this)).harvest(burnAddress);
                lockInfo_.isPenalty = true;
                lockInfo_.penaltyUnlockTimestamp = block.timestamp;
                _burnVFinix(msg.sender, lockInfo_.voteAmount);
                _mintVFinix(burnAddress, lockInfo_.voteAmount);
                IRewardFacet(address(this)).updateUserDebt(burnAddress);
                emit finixUnlockPenalty(msg.sender, _lockIndex, lockInfo_.level, lockInfo_.voteAmount);
       }else {
            // Mark Unlock
            lockInfo_.isUnlocked = true;
            // Burn vFinix
            _burnVFinix(msg.sender, lockInfo_.voteAmount);

            // Decreaase total Lock Amount
            uint256 userLocksAmount_ = ds.userLocksAmount[msg.sender];
            ds.userLocksAmount[msg.sender] = userLocksAmount_.sub(lockInfo_.lockAmount);
            // Transfer back FINIX
            IKIP7(FINIX).transfer(msg.sender, lockInfo_.lockAmount);
            // update lock data
            _decreaseTotalLockCount();
            _decreaseTotalLevelLockCount(lockInfo_.level);
            ds.totalFinixLockAtLevel[lockInfo_.level] = ds.totalFinixLockAtLevel[lockInfo_.level].sub(lockInfo_.lockAmount);
            ds.totalFinixLock = ds.totalFinixLock.sub(lockInfo_.lockAmount);   

        }

        // decrease lock plus level
        if(getIsLockTopUp(msg.sender,_lockIndex) == true){
            uint256 _totalLockPlus = LibDiamond.getUint(keccak256(abi.encode(lockInfo_.level,"vfinix.TopUpFeature.TotalLock.level")));
            LibDiamond.setUint(keccak256(abi.encode(lockInfo_.level,"vfinix.TopUpFeature.TotalLock.level")),_totalLockPlus.sub(lockInfo_.lockAmount));
        }
        IRewardFacet(address(this)).updateUserDebt(msg.sender);
        _increaseTotalSupplyAllTimeBurn(lockInfo_.voteAmount);

        emit finixUnlock(msg.sender,lockInfo_.lockAmount,lockInfo_.voteAmount,_lockIndex);
    }

    function getIsLockTopUp(address _user,uint256 userLocksCount_) internal view returns(bool) {
        return LibDiamond.getBool(keccak256(abi.encode(_user,userLocksCount_,"vfinix.TopUpFeature.isLockTopUp")));
    }

    function getTotalFinixLock() public override view returns(
        uint256 totalFinixLock_,
        uint256 totalFinixLockAtLevel1_,
        uint256 totalFinixLockAtLevel2_,
        uint256 totalFinixLockAtLevel3_,
        uint256 totalLockCount_,
        uint256 totalLockLevel1Count_,
        uint256 totalLockLevel2Count_,
        uint256 totalLockLevel3Count_) {

        // 
        LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();
        totalFinixLock_ = ds.totalFinixLock;
        totalFinixLockAtLevel1_ = ds.totalFinixLockAtLevel[LibDiamond.LockLevel.Level1];
        totalFinixLockAtLevel2_ = ds.totalFinixLockAtLevel[LibDiamond.LockLevel.Level2];
        totalFinixLockAtLevel3_ = ds.totalFinixLockAtLevel[LibDiamond.LockLevel.Level3];
        totalLockCount_ = LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_COUNT)));
        totalLockLevel1Count_ = LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_COUNT,LibDiamond.LockLevel.Level1)));
        totalLockLevel2Count_ = LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_COUNT,LibDiamond.LockLevel.Level2)));
        totalLockLevel3Count_ = LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_COUNT,LibDiamond.LockLevel.Level3)));
    }


    function setUpLockPeriods(
        LibDiamond.ParamLockPeriods memory param_
    ) external override {
        LibDiamond.enforceIsContractOwner();

        LibDiamond.setUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,LibDiamond.LockLevel.Level1,"period")),param_._period1);
        LibDiamond.setUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,LibDiamond.LockLevel.Level1,"multiplier")),param_._multiplier1);
        LibDiamond.setUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,LibDiamond.LockLevel.Level1,"minimum")),param_._minimum1);
        LibDiamond.setUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,LibDiamond.LockLevel.Level1,"penaltyPeriod")),param_._penaltyPeriod1);
        LibDiamond.setUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,LibDiamond.LockLevel.Level1,"penaltyRate")),param_._penaltyRate1);
        LibDiamond.setUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,LibDiamond.LockLevel.Level1,"penaltyRateDecimal")),param_._penaltyRateDecimal1);

        LibDiamond.setUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,LibDiamond.LockLevel.Level2,"period")),param_._period2);
        LibDiamond.setUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,LibDiamond.LockLevel.Level2,"multiplier")),param_._multiplier2);
        LibDiamond.setUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,LibDiamond.LockLevel.Level2,"minimum")),param_._minimum2);
        LibDiamond.setUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,LibDiamond.LockLevel.Level2,"penaltyPeriod")),param_._penaltyPeriod2);
        LibDiamond.setUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,LibDiamond.LockLevel.Level2,"penaltyRate")),param_._penaltyRate2);
        LibDiamond.setUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,LibDiamond.LockLevel.Level2,"penaltyRateDecimal")),param_._penaltyRateDecimal2);

        LibDiamond.setUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,LibDiamond.LockLevel.Level3,"period")),param_._period3);
        LibDiamond.setUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,LibDiamond.LockLevel.Level3,"multiplier")),param_._multiplier3);
        LibDiamond.setUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,LibDiamond.LockLevel.Level3,"minimum")),param_._minimum3);
        LibDiamond.setUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,LibDiamond.LockLevel.Level3,"penaltyPeriod")),param_._penaltyPeriod3);
        LibDiamond.setUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,LibDiamond.LockLevel.Level3,"penaltyRate")),param_._penaltyRate3);
        LibDiamond.setUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,LibDiamond.LockLevel.Level3,"penaltyRateDecimal")),param_._penaltyRateDecimal3);
    }

    function setLockPeriod(LibDiamond.LockLevel _level,uint256 _period,uint256 _multiplier,uint256 _mininum,uint256 _penaltyPeriod,uint256 _penaltyRate,uint256 _penaltyRateDecimal) external override {
        LibDiamond.enforceIsContractOwner();
        LibDiamond.setUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,_level,"period")),_period);
        LibDiamond.setUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,_level,"multiplier")),_multiplier);
        LibDiamond.setUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,_level,"minimum")),_mininum);
        LibDiamond.setUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,_level,"penaltyPeriod")),_penaltyPeriod);
        LibDiamond.setUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,_level,"penaltyRate")),_penaltyRate);
        LibDiamond.setUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,_level,"penaltyRateDecimal")),_penaltyRateDecimal);
    }
    function getLockPeriod(LibDiamond.LockLevel _level) external override view returns(uint256 period_,uint256 multiplier_,uint256 minimum_,uint256 penaltyPeriod_,uint256 penaltyRate_,uint256 penaltyRateDecimal_) {
        return _getLockPerioid(_level);
    }

    function _getLockPerioid(LibDiamond.LockLevel _level) internal view returns(uint256 period_,uint256 multiplier_,uint256 minimum_,uint256 penaltyPeriod_,uint256 penaltyRate_,uint256 penaltyRateDecimal_) {
        period_ = LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,_level,"period")));
        multiplier_ = LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,_level,"multiplier")));
        minimum_ = LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,_level,"minimum")));
        penaltyPeriod_ = LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,_level,"penaltyPeriod")));
        penaltyRate_ = LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,_level,"penaltyRate")));
        penaltyRateDecimal_ = LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,_level,"penaltyRateDecimal")));
    }
    function _increaseTotalSupplyAllTimeMint(uint256 _amount) internal {
        LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();
        ds.totalSupplyAllTimeMint = ds.totalSupplyAllTimeMint.add(_amount);
    }
    function _increaseTotalSupplyAllTimeBurn(uint256 _amount) internal {
        LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();
        ds.totalSupplyAllTimeBurn = ds.totalSupplyAllTimeBurn.add(_amount);

    }
    function _mintVFinix(address _holder,uint256 _amount) internal {
        LibDiamond.increaseTotalSupply(_amount);
        LibDiamond.increaseBalance(_holder,_amount);
        emit LibDiamond.Transfer(address(0), _holder, _amount);
    }

    function _burnVFinix(address _holder,uint256 _amount) internal {
        LibDiamond.decreaseTotalSupply(_amount);
        LibDiamond.decreaseBalance(_holder, _amount);
        emit LibDiamond.Transfer(_holder, address(0), _amount);
    } 

    function _increaseTotalLockCount() internal  {
        uint256 totalLockCount = LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_COUNT)));
        LibDiamond.setUint(keccak256(abi.encodePacked(KEY_LOCK_COUNT)),totalLockCount.add(1));
    }


    function _increaseTotalLevelLockCount(LibDiamond.LockLevel _level) internal  {
        uint256 totalLockCount = LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_COUNT,_level)));
        LibDiamond.setUint(keccak256(abi.encodePacked(KEY_LOCK_COUNT,_level)),totalLockCount.add(1));
    }

     function _decreaseTotalLockCount() internal  {
        uint256 totalLockCount = LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_COUNT)));
        LibDiamond.setUint(keccak256(abi.encodePacked(KEY_LOCK_COUNT)),totalLockCount.sub(1));
    }

    function _decreaseTotalLevelLockCount(LibDiamond.LockLevel _level) internal  {
        uint256 totalLockCount = LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_COUNT,_level)));
        LibDiamond.setUint(keccak256(abi.encodePacked(KEY_LOCK_COUNT,_level)),totalLockCount.sub(1));
    }

